import React from "react";
import { useState } from "react";
import "./Sidebar.css";

function Sidebar() {
  const [isExtended, setIsExtended] = useState(false);

  return (
    <div
      className={`sidebar ${isExtended ? "extended" : ""}`}
      onClick={() => setIsExtended(!isExtended)}
    >
      <ul>
        {/* Sidebar items */}
        <li>Item 1</li>
        <li>Item 2</li>
        {/* ... */}
      </ul>
    </div>
  );
}
export default Sidebar;
